スポーツタイプの自転車にオススメ<BR>
<BR>
シートポストに簡単取付けできる工具不要後付けリアキャリア。<BR>
<BR>
丈夫で軽量なアルミ製荷台ゴムひも付で荷物を固定できる。<BR>
<BR>
■取付可能シートポスト径：約22～32mm（ゴムスペーサー付属）<BR>
<BR>
■サイズ（約）全長480mm（荷台280mm）　幅120mm<BR>
<BR>
注意事項<BR>
■輸入品につき、若干スレキズ等ある場合がございます。<BR>
<BR>
■汎用品の為、適合車種についてのご質問にはお答え致しかねます。<!-- ↓ここからコンパス「共通説明文(大)」設置用HTMLタグです↓(※この文章も一緒にお貼り付けください。)

