スポーツタイプの自転車にオススメ<BR>
<BR>
最大積載重量は約25Kg!!<BR>
<BR>
3点共クイックリリースレバー付きなのでシートポスト・リアフレー<BR>
<BR>
ムに簡単取り付け!!<BR>
<BR>
荷台部分は可動式となっているので、お使いの自転車にフィット!!<BR>
<BR>
リフレクター付き!パニアバッグの取り付けも可能。<BR>
<BR>
【材質】アルミ<BR>
<BR>
【サイズ】[全長]約580(最大)～540(最短)×145(mm)<BR>
　　　　　[天板] 約360×145(mm)<BR>
<BR>
【取付けシートポスト径】約22～32mm ※付属のゴムで調節可能<BR>
<BR>
【重量】約1.1kg<BR>
<BR>
【耐荷重】約25Kg(シートポスト、リアフレーム装着時)/約8kg（シートポストのみ装着時）<BR>
<BR>
注意事項<BR>
■輸入品につき、若干スレキズ等ある場合がございます。<BR>
<BR>
■汎用品の為、適合車種についてのご質問にはお答え致しかねます。<!-- ↓ここからコンパス「共通説明文(大)」設置用HTMLタグです↓(※この文章も一緒にお貼り付けください。)

